import cv2
import numpy as np
from skimage.metrics import mean_squared_error

def min_rect_area(image):
  gray = cv2.cvtColor(image, cv2.COLOR_BGR2GRAY)
  ret, thresh = cv2.threshold(gray, 0, 255, cv2.THRESH_BINARY_INV | cv2.THRESH_OTSU)
  contours, _ = cv2.findContours(thresh, cv2.RETR_EXTERNAL, cv2.CHAIN_APPROX_SIMPLE)
  largest_contour = max(contours, key=cv2.contourArea)
  xa, ya, wa, ha = cv2.boundingRect(largest_contour)
  nonZeroCoordinates = cv2.findNonZero(thresh)
  x, y, w, h = cv2.boundingRect(nonZeroCoordinates)
  cropped_image = image[y:y+h, x:x+w]
  return cropped_image

def image_transform(image_gray) :
  blur = cv2.GaussianBlur(image_gray, (5,5), 1)
  _, thresholded_image = cv2.threshold(blur, 120, 255, cv2.THRESH_BINARY)
  return thresholded_image


def get_difference(image, ravan):
  resized_image = cv2.resize(image, (ravan.shape[1], ravan.shape[0]))
  image_gray = cv2.cvtColor(resized_image, cv2.COLOR_BGR2GRAY)
  thresh = image_transform(image_gray)
  edges = cv2.Canny(thresh, 50, 150)
  template_gray = cv2.cvtColor(ravan, cv2.COLOR_BGR2GRAY)
  mse = mean_squared_error(image_gray, template_gray)
  return mse


def get_similarity(image, ravan):
  resized_image = cv2.resize(image, (ravan.shape[1], ravan.shape[0]))
  image_gray = cv2.cvtColor(resized_image, cv2.COLOR_BGR2GRAY)
  template_gray = cv2.cvtColor(ravan, cv2.COLOR_BGR2GRAY)
  thresh = image_transform(image_gray)
  blur = cv2.GaussianBlur(thresh, (5,5), 1)
  edges = cv2.Canny(blur, 50, 150)
  result = cv2.matchTemplate(image_gray, template_gray, cv2.TM_CCOEFF_NORMED)
  min_val, max_val, min_loc, max_loc = cv2.minMaxLoc(result)
  return max_val

